import React from 'react';
import style from 'styled-components';


const FooterBottom = style.footer`
    background: transparent;
    width: 100%;
    height: -60px;
    z-index: 10;

    img {
        height: 50px;
        width: 50px;
        cursor: pointer;
    }
    `;

function Footer() {
    return (
        <>
            <FooterBottom>
                <img href="/LinkedIn" src={require("../logos/linkedin.png")} />
                <img href="/Github" src={require("../logos/github.png")} /> 
            </FooterBottom>
        </>
    );  
}

export default Footer;
